double get_mass(int nid){
    double res = 0.0;
    ame ref;
    ref.nid = nid;
    auto it = std::lower_bound(std::begin(ame16_data),
                               std::end(ame16_data),
                               ref,
                               [](const ame &e, const ame &n){
                               return (e.nid < n.nid);
               });
    if(it->nid == nid && it!=std::end(ame16_data)){
        res = it->mass;
    }
    return res;
}

